import React from "react";

const Box = ({DataMenu}) => {

    return (
        <div style={{display:"flex"}}>
            {DataMenu.length >= 1 ? (DataMenu.map((item) => {
                    return (
                        <div className="card" >
                            <img className="image-menu" src="image-1.jpg" />
                            <div className="text" >
                                <h5>{item.name}</h5>
                                <p>{item.data}</p>
                                <b>{item.price}</b>
                            </div>
                        </div>
                    )
                })) : <h2 className="no-food" >There are no items</h2> }
        </div>
    )
}

export default Box
